import React from "react";
import classes from "./MealItemForm.module.css";
import Input from "./Input";

const MealItemForm = () => {
  return (
    <form className={classes.form}>
      <input
        label="Amount"
        input={{
          type: "number",
          id: "amount",
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
        }}
      />
      <button>+ Add</button>
    </form>
  );
};

export default MealItemForm;
